pr_body:
Closes #1881. This is the second part of my first PR #2343.

This PR is part of the ``Google Summer of Code 2023`` program.

I will be updating my Logs inside my [domain](https://k0t0z.github.io).

#### Note: :heavy_check_mark: means that SOG/unit tests for the corresponding function are provided.

---------------------------------------------------------------------------------------------------

:white_check_mark: [Leaderboards API](https://github.com/YoYoGames/GMEXT-Steamworks/wiki/Leaderboards)
 - :white_check_mark: steam_create_leaderboard();
 - :white_check_mark: steam_upload_score();
 - :white_check_mark: steam_upload_score_ext();
 - :white_large_square: steam_upload_score_buffer();
 - :white_large_square: steam_upload_score_buffer_ext();
 - :white_check_mark: steam_download_scores();
 - :white_check_mark: steam_download_scores_around_user();
 - :white_check_mark: steam_download_friends_scores();
 - :white_large_square: ``LeaderboardEntry`` data type
 - :white_check_mark: ``LeaderboardDisplayType`` constant
 - :white_check_mark: ``LeaderboardSortOrder`` constant

---------------------------------------------------------------------------------------------------

:white_check_mark: [Social API](https://github.com/YoYoGames/GMEXT-Steamworks/wiki/Social)
 - :white_check_mark: steam_set_rich_presence();
 - :white_check_mark: steam_set_clear_presence();
 - :white_check_mark: steam_user_set_played_with();
 - :white_large_square: steam_get_friends_game_info();
 - :white_check_mark: steam_get_user_avatar();
 - :white_check_mark: steam_image_get_size();
 - :white_check_mark: steam_image_get_rgba();
 - :white_check_mark: steam_image_get_bgra();
 - :white_check_mark: steam_image_get_argb();
 - :white_check_mark: steam_image_create_sprite();

---------------------------------------------------------------------------------------------------

:white_large_square: [Cloud API](https://github.com/YoYoGames/GMEXT-Steamworks/wiki/Cloud)
 - :white_large_square: steam_is_cloud_enabled_for_app();
 - :white_large_square: steam_is_cloud_enabled_for_account();
 - :white_large_square: steam_get_quota_total();
 - :white_large_square: steam_get_quota_free();
 - :white_large_square: steam_file_exists();
 - :white_large_square: steam_file_size();
 - :white_large_square: steam_file_persisted();
 - :white_large_square: steam_file_write();
 - :white_large_square: steam_file_write_file();
 - :white_large_square: steam_file_read();
 - :white_large_square: steam_file_share();
 - :white_large_square: steam_file_delete();

---------------------------------------------------------------------------------------------------

## Must Be Done Before Merging:

:white_check_mark: Adding support for other platforms in the Makefile file.
:white_check_mark: Switching the ``Default`` property in the Steamworks & Json extensions YAML file to ``false``.
:white_check_mark: Switching the ``cxxflags`` property in ``Compilers/Linux/gcc.ey`` to ``-fdiagnostics-color=always``.
:white_large_square: Reviewing all error messages and documentation in newly added files.
:white_check_mark: Adding the license to all newly added files.
:white_check_mark: Providing installation instructions for all platforms.
:white_check_mark: Modifying the extension to call ``steam_init();`` automatically when enabled.
:white_check_mark: Match all naming conventions with GMS's Steamworks extension.
:white_large_square: Testing the APIs with the latest version of Steamworks SDK, Steam, OS version, etc.
:white_large_square: Must test all EDL scripts in the example game provided.
:white_large_square: Providing SOG/unit tests for all functions written (this need to be studied carefully as in order to test the C++ wrapper tester must have steam installed and running or I may use mocks).
:white_check_mark: Clearing garbage files.
:white_check_mark: ``DEBUG_MESSAGE()`` must exist only in APIs files. Try to remove it from wrapper files. Try to make the wrapper independent on ENIGMA.
:white_check_mark: Fix example game background design.
:white_large_square: Update the example game to match the latest version of [GMS Steamworks extension](https://marketplace.yoyogames.com/assets/10709/steamworks-ext).

:white_check_mark: The compiler must write a file next to the exe.
:white_large_square: Review includes.

:white_check_mark: Commit the example game again and remove it from ``.gitignore`` file.
:white_large_square: The extension and the example must be compatible with GameMaker.
:white_large_square: Set the title for Steamworks demo to ``Created with ENIGMA``.
:white_large_square: Monitor GMS's terminal behavior.

---------------------------------------------------------------------------------------------------

## Dependencies:

 - [Social API](https://github.com/YoYoGames/GMEXT-Steamworks/wiki/Social) depends on this #2309 (#2361).

---------------------------------------------------------------------------------------------------

## Good to have:

:white_large_square: Test the changes with [RGM](https://github.com/enigma-dev/RadialGM).
:white_large_square: Solve all build warnings.

