[{'comment_id': 1136972686, 'comment_body': "You shouldn't `#include` `.cpp` files, generally you specify your class interface in a `.h` file and then the `.cpp` contains only the implementation.", 'comment_created': datetime.datetime(2023, 3, 15, 12, 23, 12, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136973336, 'comment_body': 'You should add header include guards to this file.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 23, 44, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136979945, 'comment_body': "Would not recommend using `int` here, if the value goes beyond `int`'s max value then you will have issues with wrapping, however unlikely that may be. Best to use an actual pointer here, or the iterators returned by `std::string::begin()`/`std::string::end()`. If you want to stick with indices I would recommend using `size_t` instead.", 'comment_created': datetime.datetime(2023, 3, 15, 12, 28, 45, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136980869, 'comment_body': 'This can be simplified to `pointer_ >= data.length()`.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 29, 26, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136982563, 'comment_body': "I don't think a switch is needed here, you can just do
```cpp
if (currentState == errorState) return errorState;
```", 'comment_created': datetime.datetime(2023, 3, 15, 12, 30, 45, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136982900, 'comment_body': 'Same thing here.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 31, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136983479, 'comment_body': 'Same thing here as well.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 31, 26, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136989361, 'comment_body': 'Same issue as before with it being an `int`.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 35, 50, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136989918, 'comment_body': 'I think the parentheses here are redundant, you likely do not need so many.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 36, 16, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136990792, 'comment_body': 'Same thing here as before, this can be simplified to `temp_pointer_ >= data.length()`.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 36, 51, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1136994078, 'comment_body': 'Would also suggest using either pointers or `size_t` here.', 'comment_created': datetime.datetime(2023, 3, 15, 12, 39, 19, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1137005820, 'comment_body': 'This can probably do with a better name :slightly_smiling_face: ', 'comment_created': datetime.datetime(2023, 3, 15, 12, 47, 34, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1165393327, 'comment_body': "That's a fix for #2339 ", 'comment_created': datetime.datetime(2023, 4, 13, 11, 32, 4, tzinfo=datetime.timezone.utc), 'commenter': 'k0T0z', 'type': 'User'}, {'comment_id': 1165393760, 'comment_body': 'This just a typo fix.', 'comment_created': datetime.datetime(2023, 4, 13, 11, 32, 34, tzinfo=datetime.timezone.utc), 'commenter': 'k0T0z', 'type': 'User'}, {'comment_id': 1165396432, 'comment_body': "I don't know what this is, but it's working that way, maybe I should use some guards?", 'comment_created': datetime.datetime(2023, 4, 13, 11, 35, 6, tzinfo=datetime.timezone.utc), 'commenter': 'k0T0z', 'type': 'User'}, {'comment_id': 1170026627, 'comment_body': 'Those guards are defined to eliminate not needed headers in source files.', 'comment_created': datetime.datetime(2023, 4, 18, 13, 17, 7, tzinfo=datetime.timezone.utc), 'commenter': 'k0T0z', 'type': 'User'}, {'comment_id': 1170033057, 'comment_body': 'This ``DEBUG_MESSAGE(reader.getFormattedErrorMessages(), MESSAGE_TYPE::M_ERROR);`` causes an error as ``enigma_user::show_debug_message()`` is not recognized. I think we need to include the source file which contains the implementation for ``enigma_user::show_debug_message()``. Anyway, we don't need it in testing so we remove it using header guards. We also remove ``#include "Widget_Systems/widgets_mandatory.h"``.

Note that all new tests are passing using this change but ``std::istream& operator>>( std::istream&, Value& );`` need to be tested separately.', 'comment_created': datetime.datetime(2023, 4, 18, 13, 21, 56, tzinfo=datetime.timezone.utc), 'commenter': 'k0T0z', 'type': 'User'}, {'comment_id': 1186889110, 'comment_body': "I don't think its necessary to use `new` here, you can just take the address of the string and use that.", 'comment_created': datetime.datetime(2023, 5, 7, 17, 36, 11, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1186889144, 'comment_body': 'Generally, you would keep stuff like `= default` in your header file so that users would know that the constructor is defaulted (if they only have the headers and not the source files available).', 'comment_created': datetime.datetime(2023, 5, 7, 17, 36, 32, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1186889149, 'comment_body': 'Given that every branch of the `switch` has a return in it, this statement looks unreachable to me.', 'comment_created': datetime.datetime(2023, 5, 7, 17, 36, 38, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1186889150, 'comment_body': 'This is equivalent to `pointer_  = temp_pointer_ - 1`, which may be easier to understand.', 'comment_created': datetime.datetime(2023, 5, 7, 17, 36, 40, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1186889153, 'comment_body': "You should probably bind `levels_entities_boundaries_pointers_.top()` to a reference variable with a shorter name so that you don't have to repeat the whole expression every time, something like:
```cpp
    auto &top = levels_entities_boundaries_pointers_.top();
    top.front().first -= shift_left_;
    top.front().second -= shift_left_;

    top..front().first += offset_;
    top.front().second += offset_ + levels_entities_offsets_.top().front();

    offset_ += levels_entities_offsets_.top().front();

    levels_entities_offsets_.top().pop();

    top.push(levels_entities_boundaries_pointers_.top().front());
    top.pop();
```", 'comment_created': datetime.datetime(2023, 5, 7, 17, 36, 43, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1186889160, 'comment_body': 'You should use `enum class` to make it obvious that the names are enumerators, as it can be confusing when you use the same naming scheme as variables.', 'comment_created': datetime.datetime(2023, 5, 7, 17, 36, 49, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1186889177, 'comment_body': 'Same thing here.', 'comment_created': datetime.datetime(2023, 5, 7, 17, 36, 53, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1189478064, 'comment_body': 'actually, those return statements may not be invoked if the parsing is successful, break will be invoked instead.', 'comment_created': datetime.datetime(2023, 5, 10, 7, 36, 24, tzinfo=datetime.timezone.utc), 'commenter': 'k0T0z', 'type': 'User'}, {'comment_id': 1189752194, 'comment_body': "Ahh sorry, I didn't look carefully enough... somehow missed that", 'comment_created': datetime.datetime(2023, 5, 10, 11, 13, 13, tzinfo=datetime.timezone.utc), 'commenter': 'dc03', 'type': 'User'}, {'comment_id': 1190175520, 'comment_body': 'np, thank you very much, good luck with your project 💌.', 'comment_created': datetime.datetime(2023, 5, 10, 16, 52, 1, tzinfo=datetime.timezone.utc), 'commenter': 'k0T0z', 'type': 'User'}]

